Вот простой пример программы `Hello World` на JavaScript с использованием Node.js:

```javascript
// hello-world.js

const http = require('http');

const server = http.createServer((req, res) => {
  res.writeHead(200, { 'Content-Type': 'text/plain' });
  res.end('Hello, world!\n');
});

server.listen(8080, () => {
  console.log('Сервер запущен: http://localhost:8080/');
});
```

### Как запустить программу:
1. Сохраните код в файл с именем `hello-world.js`.
2. Откройте терминал (командную строку).
3. Перейдите в директорию, где сохранён файл.
4. Выполните команду:
   ```bash
   node hello-world.js
   ```
5. После запуска сервер начнёт работу, и вы сможете увидеть сообщение «Hello, world!» по адресу `http://localhost:8080/`.

Программа создаёт простейший веб-сервер, который выводит строку текста при обращении к нему через браузер или другой клиент HTTP.

Вот простой пример простого приложения «Hello World» на React.js:

### Шаг 1: Установка среды разработки

Убедитесь, что установлен Node.js (с помощью npm):
```bash
npm init react-app helloworldapp
cd helloworldapp
```

### Шаг 2: Запуск проекта

Запустим проект локально:
```bash
npm start
```
Откройте браузер и перейдите по адресу `http://localhost:3000`.

### Финальный код приложения

Создадим файл `/src/App.js` с содержимым:

```javascript
import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Hello, world!</h1>
    </div>
  );
}

export default App;
```

Файл стилей (`./App.css`) можно создать пустой, либо добавить стили самостоятельно:

```css
.App {
  text-align: center;
  font-size: 48px;
  color: #333;
}
```

Теперь откройте браузер и убедитесь, что видите надпись **«Hello, world!»** на экране.

Это базовый шаблон приложения React, который выводит простое сообщение. Вы можете расширять его, добавляя компоненты, стили и функциональность по своему усмотрению.

Вот простой пример простого приложения «Hello World» на React.js:

### Шаг 1: Установка и настройка среды разработки

Создай новую папку проекта (`mkdir helloworld`), перейди в неё и инициализируй проект командой `npx create-react-app .`.

```bash
npx create-react-app .
```

Запусти проект:

```bash
npm start
```

Открой браузер по адресу http://localhost:3000 — увидишь приветственное сообщение от React.

### Шаг 2: Создаём компонент HelloWorld

Создадим новый файл компонента в директории src/components/HelloWorld.jsx (или HelloWorld.tsx):

```bash
touch src/components/HelloWorld.jsx
```

Добавим туда следующий код:

```javascript
// src/components/HelloWorld.jsx
import React from 'react';

const HelloWorld = () => {
  return (
    <div className="hello-world">
      <h1>Hello, world!</h1>
    </div>
  );
};

export default HelloWorld;
```

### Шаг 3: Подключаем компонент в App.js

Теперь подключим созданный компонент в корневой файл приложения `App.js`, который находится в папке `src`. Откроем его и заменим содержимое следующим кодом:

```javascript
// src/App.js
import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom'; // импортируем роутинг
import './App.css';
import HelloWorld from './components/HelloWorld';

function App() {
  return (
    <Router>
      <HelloWorld />
    </Router>
  );
}

export default App;
```

### Шаг 4: Запускаем приложение

Повторно запусти сервер командой:

```bash
npm start
```

Теперь открой браузер и зайди по адресу http://localhost:3000, чтобы увидеть результат работы нашего приложения.

